import React from "react"
import CancelledOrders from "../components/orders/CancelledOrders";
import ConfirmedOrders from "../components/orders/ConfirmedOrders";
import NewOrders from "../components/orders/NewOrders";
import ReturnOrders from "../components/orders/REturnOrders";
import ShippedOrders from "../components/orders/ShippedOrders";

const SEC_NAV_DATA = [
  { title: "New", path: "/orders/neworders" ,component:<NewOrders/>},
  { title: "Confirmed", path: "/orders/confirmedorders" ,component: <ConfirmedOrders/> },
  { title: "Cancelled", path: "/orders/cancelledorders" ,component:<CancelledOrders/>},
  { title: "Shipped", path: "/orders/shippedorders" ,component:<ShippedOrders/>},
  { title: "Returned", path: "/orders/returnedorders",component:<ReturnOrders/> },
  { title: "Replaced", path: "/orders/replacedorders" },
  { title: "Failed", path: "/orders/failedorders" },
];

export {SEC_NAV_DATA};
